import React from "react";

class SignUp extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            email: "",
            passowrd: "",
            name: "",
        }
    }

    onNamechange = (event) =>{
        this.setState({name: event.target.value})
    }

    onEmailChange = (event) =>{
        this.setState({signInEmail: event.target.value})
    }

    onPasswordChange = (event) =>{
        this.setState({signInPassword: event.target.value})
    }

    render(){
        return(
            <article className="br2 ba dark-gray b--black-10 mv7 w-100 w-50-m w-25-l mw6 center shadow-5 ">
                <main className="pa4 black-80">
                    <form className="measure ">
                        <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="f4 fw6 ph0 mh0 center">Sign Up</legend>
                        <div className="mt3">
                            <label className="db fw6 lh-copy f6 " htmlFor="name">Name</label>
                            <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="text" name="name"  id="name" />
                        </div>
                        <div className="mt3">
                            <label className="db fw6 lh-copy f6" htmlFor="email-address">Email</label>
                            <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address" />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor ="password">Password</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password" />
                        </div>
                        </fieldset>
                        <div className="center">
                        <input onClick={() => onRouteChange('home')} className=" center b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib pointer" type="submit" value="Sign up" />
                        </div>
                    </form>
                </main>
            </article>
        )
    }
    
}

export default SignUp;
